import React from "react";
import Paper from "@material-ui/core/Paper/Paper";
import Tabs from "@material-ui/core/Tabs/Tabs";
import Tab from "@material-ui/core/Tab/Tab";
import { makeStyles } from '@material-ui/core/styles';
import TabPanel from "@material-ui/lab/TabPanel/TabPanel";

const useStyles = makeStyles({
    root: {
        flexGrow: 1,
    },
});

function a11yProps(index) {
    return {
        id: `scrollable-auto-tab-${index}`,
        'aria-controls': `scrollable-auto-tabpanel-${index}`,
    };
}
const ApplicationUnitInfo = () => {

    const classes = useStyles();
    const [value, setValue] = React.useState(0);

    const handleChange = (event, newValue) => {
        setValue(newValue);
    };

    return (
        <div>
        <p>Location</p>
        <p>On this step you will select a term, a floor plan, a unit space type, and your desired optional amenities.</p>
            <p>1. Select your lease term</p>
            <p>2. Select a Floor Plan</p>
            <Paper className={classes.root}>
                <Tabs
                    value={value}
                    onChange={handleChange}
                    indicatorColor="primary"
                    textColor="primary"
                    centered
                >
                    <Tab label="Studio" {...a11yProps(0)}/>
                    <Tab label="2 BedRoom" {...a11yProps(1)}/>
                    <Tab label="3 BedRoom" {...a11yProps(2)}/>
                    <Tab label="4 BedRoom" {...a11yProps(3)}/>
                </Tabs>
                <TabPanel value={value} index={0}>
                    Item One
                </TabPanel>
                <TabPanel value={value} index={1}>
                    Item Two
                </TabPanel>
                <TabPanel value={value} index={2}>
                    Item Three
                </TabPanel>
                <TabPanel value={value} index={3}>
                    Item Four
                </TabPanel>
            </Paper>

        </div>
    );

}

export default ApplicationUnitInfo;
